import React from "react";
import { useAuth } from "../context/AuthContext";

const Dashboard = () => {
  const { user } = useAuth();

  return (
    <div>
      <h2>Welcome, {user.role}</h2>
      {user.role === "Medical Director" && (
        <div>Special content for Medical Director</div>
      )}
      {user.role === "Charge Nurse" && (
        <div>Special content for Charge Nurse</div>
      )}
      {user.role === "Personnel Officer" && (
        <div>Special content for Personnel Officer</div>
      )}
      {/* Add role-specific content */}
    </div>
  );
};

export default Dashboard;
